                var properties = item.value.split(",").reduce(function(result, item){
                    result[item] = {};
                    return result;
                }, {});
                data.properties.selectedOptions = {
                    "type" : "object",
                    "properties": properties,
                    "additionalProperties" : false
                }
                data.required.push("selectedOptions")
